DROP TABLE IF EXISTS "tradedhouse";
CREATE TABLE "tradedhouse" ("id" INTEGER NOT NULL PRIMARY KEY, "xiaoqu" VARCHAR(255) NOT NULL, "houseType" VARCHAR(255) NOT NULL, "square" VARCHAR(255) NOT NULL, "houseUrl" VARCHAR(255) NOT NULL, "orientation" VARCHAR(255) NOT NULL, "floor" VARCHAR(255) NOT NULL, "buildInfo" VARCHAR(255) NOT NULL, "tradeDate" DATETIME NOT NULL, "perSquarePrice" VARCHAR(255) NOT NULL, "totalPrice" VARCHAR(255) NOT NULL);
